const HomePage = () => {
    return (
      // div를 안쓰고 <></>이렇게 쓰면 가상으로 묶어주는 태그를 제공합니다.
      // div를 남발하는것보다 이 방법이 더 좋습니다.
      <>
        <h1>My Home Page</h1>
        <p>
          Go to <Link to="/products">the list of products</Link>
        </p>
      </>
    );
  };
  
  export default HomePage;
